    CModalFooter,
    CRow,
    CCol,
    CProgress
  } from '@coreui/react'
  import axios from "axios";


  const API_URL = "http://192.168.43.122:8080/laravel/site40/public/api/v1/";

  const PUBLIC_URL = "http://192.168.43.122:8080/laravel/site40/public";

  const Styles={
    link:{
      textDecoration:"underline",
      fontSize:"11px",
      color:"green"
    },
    Titles:{
      color:"black"
    },
    Theme:{
      background:"rgb(250, 252, 255)"
    }
  }
    


const LoginModal=({showToast})=>{


    return (
        <>
      
      <CModal
      size="lg"
        show={true}
        onClose={()=>{}}
      >
        <CModalHeader closeButton><h1>Login</h1> </CModalHeader>
        <CModalBody>
          <CRow>
              <CCol md="8">
           

              </CCol>
          </CRow>
         
        </CModalBody>
        <CModalFooter>
        
          <CButton
            color="secondary"
            onClick={()=>{}}
          >Cancel</CButton>
        </CModalFooter>
      </CModal>
    </>
           
      )

}



export default LoginModal
